import React from "react";
import ReactDOM  from "react-dom";
import "./index.css";
var time = new Date().toLocaleTimeString()
ReactDOM.render(
  <>
    <h1 className="header">Hello Sir</h1>
    <h2 className="header"> time is {time} </h2>
  </>,
  document.getElementById("root")
)
